Nous faisons de notre mieux pour vous transmettre uniquement des demandes qui correspondent au budget et aux disponibilités que vous avez renseignées.

Si vous avez refusé cette réservation pour cause d’indisponibilité veuillez dès à présent mettre à jour votre calendrier en suivant ce <a href="%listing_calendar_edit_url%">lien</a>.

En mettant votre calendrier à jour régulièrement vous améliorez la position de votre annonce sur les résultats de recherche.

Surtout n’hésitez pas à nous faire part de vos remarques afin que nous améliorions les demandes de réservation qui vous sont envoyées.',
    'refused_booking_offerer.email.subject' => 'Vous avez rejeté une demande de réservation %booking_uid%',
    'reminder_to_rate_asker_offerer.email.message' => 'Bonjour %firstname%,

